export const styleSheet = () => ({
  root: {
    height: "68px",
    display: "flex",
    maxWidth: "235px",
    alignItems: "center",
    border: "1px solid #E6E8EC",
    padding: "0px 10px",
    borderRadius: "76px",
    marginBottom: "20px",
    "& p": {
      fontSize: "16px",
      lineHeight: "24px",
      marginLeft: "12px",
      color: "#141416",
      fontWeight: "600",
    },
  },
});
